import { Project, Step } from '../Interfaces/Interfaces';
import { ObjectId } from 'mongodb';

export const getProjects : Project[] = async () => {
    // return made up data composed of two projects
    let project1 : Project = {
        name: "Project 1",
        startDate: new Date(),
        endDate: new Date(),
        isCompleted: false,
        xp: 0,
        workers: 0,
        context: "Context 1",
        goal: "Goal 1",
        description: "Description 1",
        steps: []
    };

};
